package main

import (
	"fmt"
	"strings"
)

func main(){
	
	var moveSet = string(`



`)
	var digiCode = [5][5]string{
		{"*","*","1","*","*"},
		{"*","2","3","4","*"},
		{"5","6","7","8","9"},
		{"*","A","B","C","*"},
		{"*","*","D","*","*"}}

	var moveSetArray = strings.Split(moveSet, "\n")

	for _,elem := range moveSetArray{
		var x int = 0
		var y int = 2
		for  i :=0; i < len(elem); i++{
			switch string(elem[i]){
			case "R":
				if x < 4 && digiCode[y][x+1] != "*"{
					x++}
				break
			case "U":
				if y > 0 && digiCode[y-1][x] != "*"{
					y--
				}
				break
			case "L":
				if x >0 && digiCode[y][x-1] != "*"{
					x--
				}
				break
			case "D":
				if y < 4 && digiCode[y+1][x] != "*"{
					y++
				}
				break
			}	
		}
		fmt.Println(digiCode[y][x])
	}


	fmt.Printf("Hello")
}
 
